const toggleButton=document.getElementById('darkModeToggle');toggleButton.addEventListener('click',()=>{document.body.classList.toggle('dark-mode');});document.addEventListener("DOMContentLoaded",function(){const tooltipTriggerList=[].slice.call(document.querySelectorAll('[data-bs-toggle="tooltip"]'));tooltipTriggerList.forEach(function(tooltipTriggerEl){new bootstrap.Tooltip(tooltipTriggerEl);});});function fadeIn(element,delay){setTimeout(()=>{element.style.transition="opacity 0.5s ease-in-out";element.style.opacity=1;},delay);}
const elements=document.querySelectorAll('body > *:not(script)');let delay=0;elements.forEach(element=>{fadeIn(element,delay);delay+=200;});;